function playTransitionIn() {
	document.getElementById('transitionContainer').classList.add('active');

	document.getElementById('transitionIn').style.display = 'block';
	transitionIn.goToAndStop(0);
	transitionIn.play();
	audioIn.play();
}

function playTransitionLoading() {
	document.getElementById('transitionContainer').classList.add('active');
	window.transitionLoading.removeEventListener('loopComplete');
	if (transitionLoading.isPaused) {
		document.getElementById('transitionIn').style.display = 'none';
		document.getElementById('transitionLoading').style.display = 'block';
		transitionLoading.goToAndStop(0);
		transitionLoading.play();
		audioLoading.play();
	}
}

function playTransitionOut() {
	document.getElementById('transitionLoading').style.display = 'none';
	document.getElementById('transitionOut').style.display = 'block';
	transitionOut.goToAndStop(0);
	transitionOut.play();
	audioOut.play();
}

